import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      name: 'hi',
      fam: [{ gName: 'ace', age: 27 }, { gName: 'granny', age: 25 }]
    };
  }
  use = () => {
    this.state.fam.gName.map(name => <li>{name}</li>);
  };
  render() {
    return <div>hi</div>;
  }
}

export default App;
